
<!DOCTYPE html>
<html>
  <link href="styles/fontawesome-free-5.11.2-web/css/all.css" rel="stylesheet">
  <link href="styles/styles.css" rel="stylesheet"/>
  
  <head>
    <meta charset="UTF-8">
    <title>Tile Sort Helper Style 1</title>
  </head>
  
  <body>
    <div class="flexBoxColumn">
      <div class="flexBoxRow">
        <div style="min-width: 300px; max-width: 300px; height: 1100px; overflow: auto; border: yellow 1px solid; background-color: black;">
          <ul id="leftDisplayId" style="padding: 0px; margin: 0px;"></ul>
        </div>
        <div style="width: 100%; height: 1100px; overflow: auto; border: yellow 1px solid; background-color: black;">
          <ul id="rightDisplayId" style="padding: 0px; margin: 0px;"></ul>
        </div>
      </div>
      <div class="flexBoxColumn" style="text-align: start;">
        <div>
          INPUT TILE GROUP FOLDER: <select id="tileGroupInputDropDownId" style="width: 7em; text-align: center; font-size: 20px;"></select>
          NOTE: Press the update ('u' or 'r') after selecting a tile group and letting it load to reload again (not all tiles may have loaded the first time)
        </div>
        <div class="flexBoxRow">
          <div>
            <button id="leftRemoveButtonId" class="font-awesome-icons" title="Remove all tiles from LEFT" style="width: 30px; height: 30px;">
              <i class="fa fa-angle-double-down" style="font-size: 20px;"></i>
            </button>
          </div>
          <div>
            <button id="leftToRightMoveButtonId" class="font-awesome-icons" title="Move all tiles from LEFT to RIGHT" style="width: 30px; height: 30px;">
              <i class="fa fa-angle-double-right" style="font-size: 20px;"></i>
            </button>
          </div>
        </div>
        <div class="flexBoxRow">
          <div>
            Start Index: <input id="startIndexTextboxId" type="number" min="0" value="0" placeholder="S" style="width: 4em; text-align: center; font-size: 20px;">
          </div>
          <div>
            , End Index: <input id="endIndexTextboxId" type="number" min="0" value="0" placeholder="E" style="width: 4em; text-align: center; font-size: 20px;">
          </div>
          <div>
            <button id="rightToLeftMoveButtonId" class="font-awesome-icons" title="Move tiles from specified indexes from RIGHT to LEFT" style="width: 30px; height: 30px;">
              <i class="fa fa-angle-double-left" style="font-size: 20px;"></i>
            </button>
          </div>
        </div>
        <div>
          OUTPUT TILE GROUP: <select id="tileGroupOutputDropDownId" style="width: 7em; text-align: center; font-size: 20px;"></select>
        </div>
        <div>
          <textarea id="moveScriptOutputId" style="width: 100%;" readonly>
          </textarea>
        </div>
      </div>
    </div>
  </body>
  
  <style>
    /*
      Adjust styling
    */
    body
    {
      color: white;
      background-color: black;
    }

    /*
      Adjust to resize image margin and disable hover effects
    */
    img
    {
      margin: 1px;
    }
    img:hover
    {
      margin: 1px;
      border: 0px #ADD8E6 solid;
    }
  </style>

    const Ids =

    // Contains the tile images with the assumption that it is in the specified group, tile hash is the key
    let tileImagesReference = [];

    /**
     * Start the editor.
     * 
     * @param groupFolderName Folder name of the tile group to read from
     */
    function start(groupFolderName)
    {
      // Resets data
      tileImagesReference.splice(0, tileImagesReference.length);
      leftTileHashes.splice(0, leftTileHashes.length);
      rightTileHashes.splice(0, rightTileHashes.length);
      
      // Setup for a specific tile group
      let allTileImagesLoaded = false;
      for (let i = 0; i < ALL_TILE_HASHES.length; i++)
      {
        // Tile images that are in valid group folders are already sorted (not in UNDEFINED)
        // We only care about tile images in the specified group folder
        // Make the assumption that the tiles are in the specified group folder
        let tileImageSource = BASE_OUTPUT_DIRECTORY_PATH + '/' + IMAGES_OUTPUT_FOLDER_NAME + '/' + groupFolderName + '/' + ALL_TILE_HASHES[i] + '.png';
        
        getImage(tileImageSource, function(tileImage)
        {
          console.log('Tile Image exists: ' + (tileImage !== null));
          if (tileImage !== null)
          {
            // Only add to the reference and the right display if the tile image exists in the specified group folder
            tileImagesReference[ALL_TILE_HASHES[i]] = tileImage;
            rightTileHashes.push(ALL_TILE_HASHES[i]);
          }
          
          if (i >= ALL_TILE_HASHES.length - 1)
          {
            allTileImagesLoaded = true;
          }
        });
      }
      
      /**
       * Try and load an image given the source.
       * If the image exists, then it returns the image in the callback. Otherwise it returns null in the callback.
       * 
       * @param url Input source, for example: path to an image file on computer
       * @param callback Callback function used to get the return image
       */
      function getImage(url, callback)
      {
        let image = new Image();
        image.onload = function() { callback(image); };
        image.onerror = function() { callback(null); };
        image.src = url;
      }
      
      // Update GUI elements once all the tile images have finished loading
      let interval = setInterval(function()
      {
        console.log('Waiting for all tile images to finish loading, allTileImagesLoaded: ' + allTileImagesLoaded);
        if (allTileImagesLoaded)
        {
          updateAll(tileImagesReference);
          clearInterval(interval);
        }
      }, 100);
    }
    
    /**
     * Setup event listeners.
     * 
     * @param tileImagesReference Contains the tile images with the assumption that it is in the specified group, tile hash is the key
     */
    function setupEventListeners(tileImagesReference)
    {
      // Prevent auto-scrolling when middle clicked
      document.body.onmousedown = function(event)
      {
        if (event.button === 1)
        {
          return false;
        }
      }
      
      document.getElementById(Ids.tileGroupInputDropDown).addEventListener('change',
        function()
        {
          let tileGroup = document.getElementById(Ids.tileGroupInputDropDown).value;
          console.log(tileGroup + " selected");
          start(tileGroup);
        });
      
      document.getElementById(Ids.leftRemoveButton).addEventListener('click',
        function()
        {
          leftTileHashes.splice(0, leftTileHashes.length);
          updateAll(tileImagesReference);
          // Clear the tile group output textbox
          document.getElementById(Ids.tileGroupOutputDropDown).value = '';
          updateMoveScriptOutput();
        });
      
      document.getElementById(Ids.leftToRightMoveButton).addEventListener('click',
        function()
        {
          for (let i = leftTileHashes.length - 1; i >= 0; i--)
          {
            moveToOther(Ids.leftDisplay, i);
          }
          updateAll(tileImagesReference);
        });
      
      document.getElementById(Ids.rightToLeftMoveButton).addEventListener('click',
        function()
        {
          let startIndex = document.getElementById(Ids.startIndexTextbox).valueAsNumber;
          let endIndex = document.getElementById(Ids.endIndexTextbox).valueAsNumber;
          
          if (startIndex === null || endIndex === null)
          {
            console.warn('startIndexTextbox or endIndexTextbox is empty');
            return;
          }
          
          if (startIndex >= rightTileHashes.length || endIndex >= rightTileHashes.length)
          {
            console.warn('startIndex or endIndex greater than rightTileHashes.length');
            return;
          }
          
          for (let i = endIndex; i >= startIndex; i--)
          {
            moveToOther(Ids.rightDisplay, i);
          }
          updateAll(tileImagesReference);
        });
      
      document.getElementById(Ids.tileGroupOutputDropDown).addEventListener('change',
        function()
        {
          updateAll(tileImagesReference);
        });
      
      document.addEventListener('keydown',
        function(event)
        {
          // Redraw/update the left and right displays when user presses 'u' or 'r'
          if (event.key === 'u' || event.key === 'r')
          {
            updateAll(tileImagesReference);
          }
        });
      
      /**
       * Prevent non-numerical event response.
       * 
       * @param event event
       */
      function preventNonNumericalResponse(event)
      {
        // Between 0 and 9
        if (event.which < 48 || event.which > 57)
        {
          event.preventDefault();
        }
      }
      
      document.getElementById(Ids.startIndexTextbox).addEventListener('keypress', preventNonNumericalResponse, false);
      document.getElementById(Ids.endIndexTextbox).addEventListener('keypress', preventNonNumericalResponse, false);
    }
    
    /**
     * Setup any additional UI.
     */
    function setupUI()
    {
      // Fill out the input/output tile group drop-down list with tile group options
      let tileGroupInputSelect = document.getElementById(Ids.tileGroupInputDropDown);
      let tileGroupOutputSelect = document.getElementById(Ids.tileGroupOutputDropDown);
      for (let tileGroup of TILE_GROUP_INPUT_OPTIONS)
      {
        let optionInput = document.createElement('option');
        optionInput.text = tileGroup;
        tileGroupInputSelect.add(optionInput);
        let optionOutput = document.createElement('option');
        optionOutput.text = tileGroup;
        tileGroupOutputSelect.add(optionOutput);
      }
      tileGroupInputSelect.value = DEFAULT_INPUT_GROUP_FOLDER_NAME;
      tileGroupOutputSelect.value = '';
      start(tileGroupInputSelect.value);
    }

    /**
     * Moves the tile hash based on the index from one side to the other.
     * 
     * @param originDisplayId Origin display ID
     * @param index Index of tile hash to move
     */
    function moveToOther(originDisplayId, index)
    {
      if (originDisplayId === Ids.leftDisplay)
      {
        let tileHash = leftTileHashes.splice(index, 1);
        rightTileHashes.push(tileHash);
      }
      else if (originDisplayId === Ids.rightDisplay)
      {
        let tileHash = rightTileHashes.splice(index, 1);
        leftTileHashes.push(tileHash);
      }
    }
    
    /**
     * Update / redraw GUI.
     * 
     * @param tileImagesReference Contains the tile images with the assumption that it is in the specified group, tile hash is the key
     */
    function updateAll(tileImagesReference)
    {
      redrawDisplay(tileImagesReference, Ids.leftDisplay, leftTileHashes);
      redrawDisplay(tileImagesReference, Ids.rightDisplay, rightTileHashes);
      
      console.log('\n');
      console.log('LEFT side has: ' + leftTileHashes.length + ' tiles');
      console.log('RIGHT side has: ' + rightTileHashes.length + ' tiles');
      console.log('\n');
      
      updateMoveScriptOutput();
    }
    
    /**
     * Redraw the tile display.
     * 
     * @param tileImagesReference Contains the tile images with the assumption that it is in the specified group, tile hash is the key
     * @param displayId Display ID, either left or right
     * @param tileHashes List of tile hashes to display
     */
    function redrawDisplay(tileImagesReference, displayId, tileHashes)
    {
      let unorderedList = document.getElementById(displayId);
      unorderedList.innerHTML = '';
      
      for (let i = 0; i < tileHashes.length; i++)
      {
        let tileHash = tileHashes[i];
        
        let listItem = document.createElement('li');
        listItem.title = i;
        
        let tileImage = new Image(TILE_WIDTH * 4, TILE_HEIGHT * 4);
        tileImage.src = tileImagesReference[tileHash].src;
        tileImage.addEventListener('mouseup',
          function(event)
          {
            if (event.button === 0)
            {
              // Left mouse click
              moveToOther(displayId, i);
              
              // Note: Redrawing on every tile click is too laggy if there are too many tiles shown
              // A solution is to move the tile on click in the data arrays in the code, but not redraw it until the user clicks the refresh/redraw button/key
              // This means the user should only click tiles "backwards" since the data is stored in arrays and clicking a tile removes it from the array but the GUI still shows the old indexes until it redraws
              updateAll(tileImagesReference);
            }
            else if (event.button === 1)
            {
              // Middle mouse click
              event.preventDefault();
              document.getElementById(Ids.startIndexTextbox).value = i;
            }
            else if (event.button === 2)
            {
              // Right mouse click
              event.preventDefault();
              document.getElementById(Ids.endIndexTextbox).value = i;
            }
          }, false);
        
        // Prevent when user tries to drag an image
        tileImage.addEventListener('dragstart',
          function(event)
          {
            event.preventDefault();
          }, false);
        
        tileImage.addEventListener('contextmenu',
          function(event)
          {
            // Right click, prevent context menu from showing
            event.preventDefault();
          }, false);
        
        listItem.appendChild(tileImage);
        
        unorderedList.appendChild(listItem);
      }
    }
    
    /**
     * Update move script output text area. Commands to copy and paste as a batch script to mass move tile images from input specified group to the output specified TILE GROUP.
     */
    function updateMoveScriptOutput()
    {
      let inputTileGroup = document.getElementById(Ids.tileGroupInputDropDown).value;
      let outputTileGroup = document.getElementById(Ids.tileGroupOutputDropDown).value;
      
      document.getElementById(Ids.tileGroupOutputDropDown).style.backgroundColor = outputTileGroup === '' ? BackgroundColor.invalid : BackgroundColor.valid;
      document.getElementById(Ids.moveScriptOutput).style.backgroundColor = outputTileGroup === '' ? BackgroundColor.invalid : BackgroundColor.valid;
      
      let moveScriptOutput = '';
      moveScriptOutput += 'cd ' + BASE_IMAGE_DIRECTORY_PATH + '\n';
      for (let tileHash of leftTileHashes)
      {
        let moveScriptCommand =
          'move'
          + ' ' + inputTileGroup + '\\' + tileHash + '.png'
          + ' ' + outputTileGroup;
        moveScriptOutput += moveScriptCommand + '\n';
      }
      document.getElementById(Ids.moveScriptOutput).value = moveScriptOutput;
    }
